import React, { Component } from "react";
//import { connect } from 'react-redux';

class Home extends Component{
    render(){
        return(
            <React.Fragments>
                <div className="container">
                    <div className="container">
                        <h1 className="red-text text-darken-3 center">Materialize CSS</h1>
                        <h4 className="center">Center alignment</h4>
                        <h4 className="left">Left alignment</h4>
                        <h4 className="right">Right alignment</h4>
                    </div>
                </div>
            </React.Fragments>
        );
    }
};

export default Home;
